    <div className="">
      <div className=" gap-2">
        <div className="grid grid-cols-12 gap-2 ">
        <div className="grid grid-cols-12 gap-2">
  <div className="order-1 col-span-12 xl:col-span-9 bg-white p-4 rounded-md sticky">
    <Greeting />
  </div>
  <div className="order-3 col-span-12 xl:col-span-9 xl:h-[50vh] overflow-scroll scrollbar-hide">
    <Bodycards />
  </div>
  <div className="order-2 col-span-12 xl:col-span-3 h-[70vh] bg-white p-4 rounded-md sticky">
    <Calendar />
  </div>
</div>

        </div>
      </div>
    </div>
  );
}
